INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8266','725','168','1496','1/29/13 12:00:00 AM','0','Email','Hey Guys,  I hope you guys had a good weekend. I am emailing you for a couple of different emails.  First, my records show that all of you have completed the ORIENTATION. Congrats!  Second, please let me know how many hours you have completed as of Tuesday January 29th.  If you could please email me as soon as possible that would be great!  If you guys have any questions or concerns feel free to contact me as soon as possible.  Thank you,  Victoria Fonseca','Winter 2013',null,null,null);
