INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8264','725','168','1492','1/29/13 12:00:00 AM','0','Email','Hey Guys,  I hope you guys had a good weekend. I am emailing you for a couple of different emails.  First, my records show that all of you have completed the ORIENTATION for St. Josephs. Congrats! If you are working with the children you MUST complete the Virtus training session. I know that some of you have been worried because some of them are in the suburbs but Beatrice will be holding a training session on February 5, 2013 @ 6pm. You have to complete the virtus training before working with the children. If you are NOT working with children you DO NOT need to complete the Virtus training. Please email me as soon as you have completed the training session.  Second, for those of you who have completed the training and have started your service please let me know how many hours you have completed as of Tuesday January 29th.  If you could please email me as soon as possible that would be great!  If you guys have any questions or concerns feel free to contact me as soon as possible.  Tha','Winter 2013',null,null,null);
