INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8230','702','185','1505','1/29/13 12:00:00 AM','5','Email','1. Peter Kelly 2. 5 hours 3. 1 hour on 01/12/13 and 4 hours on 01/26/13 4. On January 12 we met with the NAARP for a one hour orientation: we received information about the organization, learned and practiced how to present the legislation we are trying to pass. On January 26 we met at "Imagine Englewood If" and went door to door acquiring signatures for legislation we are trying to pass from noon until 4 P.M','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8229','1126','143','1466','1/29/13 12:00:00 AM','0','Email',' Victoria,   I did have a good week indeed, I hope you''re enjoying your weekend so far. I spoke with Beatrice regarding the orientation, she thought my name was included with the attachments of the volunteers name and it wasn''t, hence the reason I never got updated with any information. We were able to set a date and time for orientation and I did attend last week with Iris instead of Beatrice because she was unavailable. I''m still waiting to hear from Beatrice about the available days and times for the manditory three hour Virtus Training that I need to attend before volunteering. I''m not able to volunteer if I have not completing the training is that correct? Thank you   Izis','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8228','640','181','1598','1/29/13 12:00:00 AM','6','Telephone',' hello,  My name is Brittany Jones  I have 6 hours, including the orientation. I cooked food and helped the students with their homework. ','Winter 2013',null,null,null);
