INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8226','1126','184','1453','1/29/13 12:00:00 AM','0','Email','Hello Tyler,  There is a virtus training with Beatrice at the service sight of February 5th.  Thank you,  Victoria From: tydei93@aol.com [tydei93@aol.com] Sent: Monday, January 28, 2013 4:43 PM To: Fonseca, Victoria Subject: Service Learning site -Tyler Middlebrook Hi Victoria,  I am emailing you in regards that I am having several issues with my site. I am at the Saint Joseph''s Services site and I am signed up to work with the children''s after-school activities. Though currently I am unable to do so because u don''t bot have something called vertus training. I have tried to register and sign up for the training but none of them fit my time frame. I am a full time biology student and I am a babysitter Tuesdays and thursdays. The training sessions are 3 hrs long and are out in the suburbs, in which I have no way to due to that I am an out of state student. Is there anyway a training can be set up at the actual site. If nit us there an arrangement u can set up to find a new site so that I','Winter 2013',null,null,null);
