INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('8037','1126','143','1466','1/25/13 12:00:00 AM','0','Email','Dear Bea, The only days I can volunteer are Thursday from 1 to needed and Fridays from 2 to needed. It would be much better for me if it''s at the Humboldt Park location since its much closer to school that way I can come after school since I live in Hoffman Estates. Also, do you have other hours I can volunteer since I''ll only have ten hours by the tenth week if I only volunteer two hours a week? My professor recommended even doing something from home that could help. If there is absolutely nothing to do at the Humboldt park location and you have availability at the Austin location Thursday''s and Friday''s then that would be okay with me. If there is opening at the Austin location then the availability hours might slightly change since I''ll be driving further distance from DePaul.  Thank you for your time  Izis','Winter 2013',null,null,null);
