INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('7874','640','164','1452','1/22/13 12:00:00 AM','0','Email','I responded with this message: Hello Maureen  Sorry for the late reply. Since it is the third week of the quarter, I cannot change your service site. It is not in my power to do so. Many of the other slots and sections have already been filled. You can speak with your professor about this matter. If you find a site that is closer than Austin and would like to complete your service there, the professor would have to confirm it first. That information would then be sent to the Steans Center. I hope this helps and everything works out for the best.','Winter 2013',null,null,null);
