INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('7867','872','180','1512','1/22/13 12:00:00 AM','0','Email','Hi Jeremy,  I corresponded with Jean Carter Hill from IEI about coming this weekend. She said she would call me but I haven''t heard from her. I was hoping to go tomorrow because my schedule during the week is harder to work with. I am going to try to call her tomorrow and  still go, but I''m not sure I will be able to get ahold of her. Just wanted to let you know where I''m at with that. I will follow up regarding this matter.','Winter 2013',null,null,null);
