INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('7864','640','153','1484','1/22/13 12:00:00 AM','0','Email','Hi, Jeremy   I actually do have a question. I emailed it to my instructor earlier but have not received a reply so far would like to run it past you. In module one, it is stated that students are to begin their service effective week three but I attended orientation onsite last Saturday and they are expecting me tomorrow (week two). Can you clarify this, please? The organization is "Because I Care" located at 5811 W. Chicago Avenue.  ','Winter 2013',null,null,null);
