INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('7861','618','180','1568','1/22/13 12:00:00 AM','2.5','Email','Hi!   This is my primary email. My phone number is 847-345-1460. I have completed orientation for ACP as well as started volunteering. As of today, I have completed 2 1/2 hours. I will be at my site on Thursday & Friday and have completed 3 hours each day.   Thank you!   Brittany N. Cesario DePaul University Chicago College of Communication 847-345-1460 Cesario.brittany@gmail.com','Winter 2013',null,null,null);
