INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('7758','1126','143','1464','1/18/13 12:00:00 AM','0','Email','Hey Guys,  My name is Victoria Fonseca and I will be your Service Learning Coordinator this quarter for St. Josephs Services CSS 300. I am currently a Senior here at DePaul majoring in Psychology with a double concentration in Human Development and I/O. I am going on my third year at the Steans Center. My job this quarter is to make sure that I can answer all questions and concerns you have for your service site.   There are a couple things that I would like to double check.   1. Would you please reply to this email so I know that I have the appropriate email address. I will be sending out weekly emails to check and make sure you are doing your hours and that there are no problems with the organization.   2. Would you also send me an appropriate telephone number? If there is no communication via email than I will call weekly to make sure that you are still involved with the organization and getting your hours done.   3. I would like to know if you have completed orientation or at least','Winter 2013',null,null,null);
