INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('7190','1207','74','916','11/14/12 12:00:00 AM','8','Email','Nov 2- Chicago Peace movement meeting which focused on youth and violence. Listening tours and workshop activities were planned for various schools in the community (2 hrs)   Nov 7- Planning for Englewood youth forum at KKC was held at Sen. Mattie Hunters office. Discussed workshops that would be included to engage youth in dialogue (2.5 hrs)  Nov 10- Englewood Land use panning meeting. Various land use plans were presented by the city and citizens could ask questions and give suggestions (3.5 hrs)','Fall 2012',null,null,null);
