INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('6460','640','67','879','11/1/12 12:00:00 AM','0','Email','Told her that I''m glad she learned a great deal from doing service there and I''m glad that she responded critically every time I contacted her. Wished her a good rest of the quarter','Fall 2012',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('6459','640','67','879','10/30/12 12:00:00 AM','0','Email','Final Response "I learned a lot about myself. I learned that I need to become a better leader and be less scared to be strict and mean when I have to be. I have always been a very blunt person, but I have always said things in a nice tone. This simple fact of paying attention to my tone, facial expression and what I say all together makes the difference in the working world and in all aspects of my life. The beginning was slow, picked up and I was happy there. Until the last few weeks i felt like I was not really helping. I felt that the kids were stuck the way they were and that I could not do much about it. I spoke with the director and told him how I felt. He said even my small impact makes a difference and even though that is hard for me to see, it does make a difference. I also asked a child if they enjoyed their time at BecauseICare and if they think the teachers are good and care. She said yes to all my questions as if they were stupid of me to ask. I found this to leave me with','Fall 2012',null,null,null);
